import React from 'react';
import { useParams, useNavigate } from 'react-router-dom';

function Modal() {
    let { id } = useParams();
    let navigate = useNavigate();

    const handleClose = () => {
        navigate(-1); // 이전 페이지로 돌아갑니다.
    };

    return (
        <div className="modal">
            {/* 모달 내용 */}
            <p>포스트 ID: {id}</p>
            <button onClick={handleClose}>닫기</button>
        </div>
    );
}

export default Modal;
